import React , { useState } from "react";
import { Form, Input, Button ,InputNumber, DatePicker } from "antd";
import { connect } from "react-redux";
import axios from "axios";
import ApplicantLayout from "../../containers/templates/applicant/applicantlayout"
import axiosInstance from "../connection";

const FormItem = Form.Item;


export default function BusinessCreateForm () {

  // const history = useHistory();
	const initialFormData = Object.freeze({
		business_name: '',
		phone_number: '',
		industry: '',
    email: '',
    director_first_name: '',
    director_last_name: '',
    director_other_name: '',
    director_phone_number: '',
    director_email: '',
    // time: '',
	});

	const [formData, updateFormData] = useState(initialFormData);

	const handleChange = (e) => {
		updateFormData({
			...formData,
			// Trimming any whitespace
			[e.target.name]: e.target.value.trim(),
		});
	};

	const handleSubmit = (e) => {
		e.preventDefault();
		console.log(formData);

		axiosInstance
			.post(`business/Business/`, {
			business_name: formData.business_name,
			phone_number:formData.phone_number,
		  industry:formData.industry,
      email:formData.email,
      director_first_name:formData.director_first_name,
      director_last_name:formData.director_last_name,
      director_other_name:formData.director_other_name,
      director_phone_number:formData.director_phone_number,
      director_email:formData.director_email,
      // time:formData.time,

			})
			// .then((res) => {
			// 	history.push('/login');
			// 	console.log(res);
			// 	console.log(res.data);
			// });
	};

	// const classes = useStyles();



    return (
      <div>
          <ApplicantLayout>
        <Form>

          <FormItem label="Business Name">
            <Input 
            id="business_name"
            name="business_name" 
						label="Business Name"
						onChange={handleChange}
            placeholder="Input a business name here" 
            />
          </FormItem>

          <FormItem label="Phone Number">
            <Input 
            id="phone_number"
            name="phone_number" 
						label="Phone Number"
						onChange={handleChange}
            placeholder="Input a business phone number here" 
            />
          </FormItem>

          <FormItem label="Industry">
            <Input 
            id="industry"
            name="industry" 
						label="Industry"
						onChange={handleChange}
            placeholder="Input a business industry here" 
            />
          </FormItem>

          <FormItem label="Email">
            <Input 
            	id="email"
              name="email" 
             label="Email Address"
             onChange={handleChange}
            placeholder="Input a business email here" 
            />
          </FormItem>

          <FormItem label="Director First Name">
            <Input 
            	id="director_first_name"
              name="director_first_name"
             label="Director First Name"   
             onChange={handleChange}
            placeholder="Input a business director first name here" 
            />
          </FormItem>

          <FormItem label="Director Last Name">
            <Input 
            	id="director_last_name"
              name="director_last_name"
             label="Director Last Name"   
             onChange={handleChange}
            placeholder="Input a business director last name here" 
            />
          </FormItem>

          <FormItem label="Director Other Name">
            <Input 
            	id="director_other_name"
              name="director_other_name"
             label="Director Other Name"   
             onChange={handleChange}
            placeholder="Input a business director other Name here" 
            />
          </FormItem>

          <FormItem label="Director Phone Number">
            <Input 
            	id="director_phone_number"
              name="director_phone_number"
             label="Director Phone Number"   
             onChange={handleChange}
            placeholder="Input a business director Phone Number here" 
            />
          </FormItem>

          <FormItem label="Director Email">
            <Input 
            	id="director_email"
              name="director_email"
             label="Director Email"   
             onChange={handleChange}
            placeholder="Input a business director Email here" 
            />
          </FormItem>




        {/* <Form.Item label="Date of Birth">
        <DatePicker label="Date_of_birth" placeholder="Enter some content ..." />
        </Form.Item> */}



          <FormItem>
            <Button 
            type="submit"
						fullWidth
						variant="contained"
						color="primary"
						onClick={handleSubmit}
            >
            Create
            </Button>
          </FormItem>

        </Form>
        </ApplicantLayout>
      </div>
    );

}

const mapStateToProps = state => {
  return {
    token: state.token
  };
};
